import React from 'react';
import { useDrag } from 'react-dnd';
import './Cloud.css';

const DraggableCloud = () => {
    const [, ref] = useDrag({
        type: 'CLOUD',
    });

    return <div className='cloud draggable' ref={ref}></div>;
};

function Cloud() {
    return (
        <div className='container-cloud'>
            <DraggableCloud />
            <DraggableCloud />
        </div>
    );
}

export default Cloud;
